//Adapted from https://www.iquilezles.org/www/articles/distfunctions/distfunctions.htm - Finite Repetition

vec3 opRepLim(vec3 p,vec3 c,vec3 l){
    p+=(c*l)/2.0;
    return p-c*clamp(floor(p/c+0.5),vec3(0.0),l);
}

shader_model.instance:
//From https://www.shadertoy.com/view/wlyBWm by @paulofalcao

vec3 smoothrepeat_$name(vec3 p,vec3 smooth_size,vec3 size){
    size.$Axis/=2.0;
    float w=pow(2.0,float($Iterations));
	for(int i=0;i<$Iterations;i++){
        p.$Axis=sqrt(p.$Axis*p.$Axis+smooth_size.$Axis);//smooth abs
		p.$Axis-=size.$Axis*w;//translate
		w=w/2.0;
	}
	return p;
}

float blakle_smoothrepeat_asin_sin_$name(vec3 p,vec3 smooth_size,vec3 size){
    vec3 t=p;
    t.$Axis/=size.$Axis;
    t.$Axis=(asin(sin(t.$Axis)*(1.0-smooth_size.$Axis)))*size.$Axis;
	p.$Axis=t.$Axis;
    return $in(p);
}

shader_model.global:
//Uses shapes from https://www.iquilezles.org/www/articles/distfunctions/distfunctions.htm by iq
//And Smooth Repetition in https://www.shadertoy.com/view/wlyBWm by blakle

float iq_sdRoundBox(in vec3 p,in vec3 b, float r ){
  vec3 q = abs(p) - b;
  return length(max(q,0.0)) + min(max(q.x,max(q.y,q.z)),0.0)-r;
}

float iq_opSmoothIntersection( float d1, float d2, float k ) {
    float h = clamp( 0.5 - 0.5*(d2-d1)/k, 0.0, 1.0 );
    return mix( d2, d1, h ) + k*h*(1.0-h);
}

shader_model.instance:
vec3 blakle_smoothrepeat_asin_sin_$name(vec3 p,vec3 smooth_size,vec3 size){
    vec3 t=p;
    t.$Axis/=size.$Axis;
    t.$Axis=(asin(sin(t.$Axis)*(1.0-smooth_size.$Axis)))*size.$Axis;
	p.$Axis=t.$Axis;
    return p;
}

float Blackle_SDF3D_Smooth_Repeat_$name(vec3 p,vec3 size,vec3 rep,vec3 smooth_,float smoothb){
  float b=iq_sdRoundBox(p,size*rep,smoothb);
  p=blakle_smoothrepeat_asin_sin_$name(p,smooth_,size);
  return iq_opSmoothIntersection($in(p),b,smoothb);
}

vec2 input_$name(vec3 p) {
    float sdfa=$sdf_a(p);
	float sdfb=$sdf_b(p);
	if (sdfa<sdfb) {
	  return vec2(sdfa,0.0);
	} else {
	  return vec2(sdfb,1.0);
	}
}

//tetrahedron normal by PauloFalcao
//https://www.shadertoy.com/view/XstGDS
vec3 normal_$name(vec3 p){  
  const vec3 e=vec3(0.001,-0.001,0.0);
  float v1=input_$name(p+e.xyy).x;
  float v2=input_$name(p+e.yyx).x;
  float v3=input_$name(p+e.yxy).x;
  float v4=input_$name(p+e.xxx).x;
  return normalize(vec3(v4+v1-v3-v2,v3+v4-v1-v2,v2+v4-v3-v1));
}

void march_$name(out float d,out vec3 p,out vec2 dS, vec3 ro, vec3 rd){
    for (int i=0; i < 500; i++) {
    	p = ro + rd*d;
        dS = input_$name(p);
        d += dS.x;
        if (d > 50.0 || abs(dS.x) < 0.0001) break;
    }
}

//from https://www.shadertoy.com/view/lsKcDD
float calcAO_$name( in vec3 pos, in vec3 nor ){
	float occ = 0.0;
    float sca = 1.0;
    for( int i=0; i<5; i++ ){
        float h = 0.001 + 0.15*float(i)/4.0;
        float d = input_$name( pos + h*nor ).x;
        occ += (h-d)*sca;
        sca *= 0.98;
    }
    return clamp( 1.0 - 1.6*occ, 0.0, 1.0 );    
}

//from https://www.shadertoy.com/view/lsKcDD
float calcSoftshadow_$name( in vec3 ro, in vec3 rd, in float mint, in float tmax){
	float res = 1.0;
    float t = mint;
    float ph = 1e10; // big, such that y = 0 on the first iteration
    for( int i=0; i<32; i++ ){
		float h = input_$name( ro + rd*t ).x;
        res = min( res, 10.0*h/t );
        t += h;
        if( res<0.0001 || t>tmax ) break;  
    }
    return clamp( res, 0.0, 1.0 );
}


vec3 raymarch_$name(vec2 uv) {
    uv-=0.5;
	vec3 cam=vec3($CamX,$CamY,$CamZ)*$CamZoom;
	vec3 lookat=vec3($LookAtX,$LookAtY,$LookAtZ);
	vec3 ray=normalize(lookat-cam);
	vec3 cX=normalize(cross(vec3(0.0,1.0,0.0),ray));
	vec3 cY=normalize(cross(cX,ray));
	vec3 rd = normalize(ray*$CamD+cX*uv.x+cY*uv.y);
	vec3 ro = cam;

	float d=0.;
	vec3 p=vec3(0);
	vec2 dS=vec2(0);
	march_$name(d,p,dS,ro,rd);

    vec3 color=vec3(0.0);
	vec3 objColor=(dS.y<0.5)?$tex3d_a(vec4(p,1.0)):$tex3d_b(vec4(p,1.0));
	float fog=max(1.0-(d/50.0),0.0);
	vec3 light=normalize(vec3($SunX,$SunY,$SunZ));
	if (d<50.0) {
	    vec3 n=normal_$name(p);
		float l=clamp(dot(-light,-n),0.0,1.0);
		float r=clamp(dot(reflect(rd,-n),light),0.0,1.0);
		float cAO=mix(1.0,calcAO_$name(p,n),$AmbOcclusion);
		float shadow=mix(1.0,calcSoftshadow_$name(p,light,0.05,5.0),$Shadow);
		color=min(vec3(max(shadow,$AmbLight)),max(l,$AmbLight))*max(cAO,$AmbLight)*objColor+pow(r,$Pow)*$Specular;
	} else {
	    color=$SkyColor(rd.y).xyz;
	}
    return color*(fog)+$SkyColor(rd.y).xyz*(1.0-fog);
}

