//by IQ
//from https://www.shadertoy.com/view/3ltSW2
vec3 iq_2dsdf_coloring( in float c )
{
    vec3 col = vec3(1.0) - sign(c)*vec3(0.1,0.4,0.7);
	col *= 1.0 - exp(-2.0*abs(c));
	col *= 0.8 + 0.2*cos(128.0*abs(c));
	col = mix( col, vec3(1.0), 1.0-smoothstep(0.0,0.015,abs(c)) );

	return col;
}

