vec3 normal_$name(vec3 p){  
  const vec3 e=vec3(0.001,-0.001,0.0);
  float v1=$sdf(p+e.xyy);
  float v2=$sdf(p+e.yyx);
  float v3=$sdf(p+e.yxy);
  float v4=$sdf(p+e.xxx);
  return normalize(vec3(v4+v1-v3-v2,v3+v4-v1-v2,v2+v4-v3-v1));
}

float distort_$name(vec3 uv){
	vec3 s=$tex3d(vec4(uv,0.0));
	return $sdf(uv+s*$Distort);
}

