//By pauloFalcao
vec4 distortHeighByNormal_$name(vec3 uv){
    float d=$sdf(uv);
	vec3 n=normal_$name(uv);
	vec3 s=$tex3d(vec4(uv-d*n,0.0));
    return vec4(s,$sdf(uv+n*(s-1.0)*$Distort));
}

shader_model.global:
vec3 smoothRot_X(vec3 p,float s,float m,float c,float distance){
  s*=0.5;
  float d=length(p.yz);
  float x=asin(sin(atan(p.y,p.z)*s)*(1.0-m))*d;
  float ds=d*s;
  float y=mix(ds,2.0*ds-sqrt(x*x+ds*ds),c);
  return vec3(p.x,x/s,y/s-distance);
}

vec3 smoothRot_Y(vec3 p,float s,float m,float c,float distance){
  s*=0.5;
  float d=length(p.xz);
  float x=asin(sin(atan(p.x,p.z)*s)*(1.0-m))*d;
  float ds=d*s;
  float y=mix(ds,2.0*ds-sqrt(x*x+ds*ds),c);
  return vec3(x/s,p.y,y/s-distance);
}

vec3 smoothRot_Z(vec3 p,float s,float m,float c,float distance){
  s*=0.5;
  float d=length(p.xy);
  float x=asin(sin(atan(p.x,p.y)*s)*(1.0-m))*d;
  float ds=d*s;
  float y=mix(ds,2.0*ds-sqrt(x*x+ds*ds),c);
  return vec3(x/s,y/s-distance,p.z);
}

vec2 twist_rot(vec2 v, float a) {
	a=a*0.01745329251;
	float s = sin(a);
	float c = cos(a);
	mat2 m = mat2(vec2(c, -s),vec2(s, c));
	return m * v;
}

vec3 twistX(vec3 v, float a){
	v.yz=twist_rot(v.yz,v.x*a);
	return v;
}

vec3 twistY(vec3 v, float a){
	v.xz=twist_rot(v.xz,v.y*a);
	return v;
}

vec3 twistZ(vec3 v, float a){
	v.xy=twist_rot(v.xy,v.z*a);
	return v;
}

